import React from "react";
import styled from "styled-components";
a
const Link = styled.a`
color: red;
${(props) =>
  props.primary &&
  css`
    color: green;
  `}
`;

const NavLink = (props) => {
return <Link>{props.children}{props.myText}</Link>;
};

export default NavLink;
